  functions:
    - name: getFinancialTransactions
      code: >-
        async function getFinancialTransactions(startDate, endDate, type,
        category, memberId, sortBy, sortOrder, limit, skip) {
          const client = await getMongoClient();
          try {
            const db = client.db();
            const filters = {};
            if (startDate) filters.date = { $gte: new Date(startDate) };
            if (endDate) filters.date = { ...filters.date, $lte: new Date(endDate) };
            if (type) filters.type = type;
            if (category) filters.category = category;
            if (memberId) filters.memberId = memberId;

            const options = {};
            if (sortBy) options.sort = { [sortBy]: sortOrder === 'desc' ? -1 : 1 };
            if (limit) options.limit = parseInt(limit);
            if (skip) options.skip = parseInt(skip);

            return await db.collection('transactions')
              .find(filters)
              .sort(options.sort || {})
              .limit(options.limit || 0)
              .skip(options.skip || 0)
              .toArray();
          } finally {
            await client.close();
          }
        }
      lastModified: 2024-08-21T08:49:22.691Z
